import Resact from 'react';

function ArticleCard(){
    return (
        <div className="ArticleCardWrapper">
            <div className="AricleCardImage">
                <img src="./" alt="boilerplate image"></img>
            </div>
            <div className="ArcileCardText">
                <h2>Article Title</h2>
                <p>Date</p>
                <p>Blub</p>
                <p>
                    <a href="#">Read More</a>
                </p>
            </div>
        </div>
    );
}

export default ArticleCard;
